      body: "<p class='firstP'>Autrefois appelé cheval de barbarie par les romains, le barbe est un cheval de selle originaire d'Afrique du Nord, plus précisément du Maghreb. Cette race est souvent associée au berbère.</p> <p>C’est un cheval rude, très résistant, et proche de l’homme, il a longtemps été utilisé comme un cheval de guerre au Maghreb, mais aussi en Italie, en Espagne et en France. Un célèbre dicton dit sur lui :</p> <p class='quots'>“Qu'il peut la faim, il peut la soif, il peut le froid, il peut le chaud, jamais il n’est fatigué”</p> <p>Sa première introduction en Europe fut pendant les conquêtes musulmanes, il sera plus tard importé en Europe comme monture de luxe ou reproducteurs d’élite. Le barbe était une monture royale, le roi Louis XIII fait son éducation équestre sur un cheval barbe appelé « Le Bonite ».</p> <p>Aujourd’hui en Algérie, il est utilisé par la Garde Républicaine. Il est également utilisé lors des fantasias, tradition célèbre au Maghreb, qui consiste a simulé des assauts de guerre.</p> <div class'link-ar'><p class='read-to'><span class='title-read-to'>Lire aussi: </span> <a href='/articles/bijoux-kabyle'> Les bijoux des Ath Yenni, un savoir-faire kabyle qui se transmet depuis des générations</a></p></div> <p>Le cheval barbe était importé en Europe comme monture de luxe. Le future roi Louis XIII fait son éducation équestre sur un cheval barbe appeler « Le Bonite »</p> <p>Le barbe a influencé de nombreuse dans le monde comme le pure race Espagnol et le Mustang.</p>",
