      body: "<p class'firstP'>Caftan El-Kadi littéralement caftan du juge est une tenue traditionnelle algérienne de Constantine. Initialement, c'était une tenue portée par les juges du royaume d’Alger, mais elle était aussi portée par les hauts fonctionnaires comme les aghas ou les bachaga. La tenu est par la suite était introduite dans le style vestimentaire féminin, aujourd’hui elle est portée principalement par les femmes. </p> <p>Ce caftan est fait de velours et de broderie d’or constantinoise, la broderie est faite selon une technique algérienne connue sous le nom de Mejboud. </p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/articles/karakou'> Le Karakou, une tenue raffinée Algéroises </a></p> <p>Les motifs bordés rappellent la nature, ce sont souvent des feuilles, des fleurs, des branches ou des animaux. Il est également brodé avec une autre technique, la fetla. Le motif le plus brodé sur ce caftan est le paon d’or, c’est un motif typiquement Algérien, et plus précisément de la région de Constantine .</p> <p>Le caftan sera introduit dans le sultanat de Fès en 1830 par les Algériens fuyant la colonisation, les artisans de Fès l’appelleront « caftan b tarz dziri », ce qui se traduit en « caftan à la broderie algérienne. » </p>",
