      id: 4,
      title: "Le Karakou, une tenue raffinée Algéroise",
      body: "<p class='firstP'>Alger fut une ville cosmopolite qui a connu beaucoup d’influence, les Algérois connu pour leur raffinement et pour leur gout du luxe en su s’approprier ses influences en les faisant évoluer et en les adaptant au mode de vie d’Alger, a l’image du karakou.</p> <h2>L’évolution du karakou</h2> <p>Le Karakou est l'évolution de La ghlila, une ancienne tenue algérienne aux origines levantine et ottomane, il a eu aussi des influences berbères-andalouse. La ghlila était fait de soie, de brocart ou de velours brodé, mais contrairement au Karakou, la ghlila avait un grand décolleté décoré de boutons d'or ou d'argent, laissant apparaître une chemise blanche et sa longueur arrivait jusqu'aux cuisses. À l'arrivée du karakou, la ghlila devient un vêtement porté par les classes sociales inférieures.</p> <h2>Le karakou à travers le temps</h2> <p>Le Karakou est une tenue traditionnelle algérienne, plus précisément d’Alger. Elle était initialement portée par les riches femmes d’Alger lors des différents événements comme les mariages ou encore les cérémonies de circoncisions.</p> <p>À l’origine cette tenue est une pièce unique, c'est-à-dire une veste en velours brodé en fils d’or réalisé par des artisans orfèvres. Tout comme le caftan, le karakou est brodé selon les techniques de broderie traditionnelle algérienne, appelée mejboud et fetla</p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/articles/caftan-el-kadi'> Caftan El kadi</a></p> <p> Cette veste est traditionnellement associée avec un seroual chelka. Aujourd’hui cette veste a été modernisée et s’adapte très bien à la mode actuelle et est associée avec différent bas souvent moderne.</p>",
