      title:
        "Les bijoux des Ath Yenni, un savoir-faire kabyle qui se transmet depuis des générations",
      body: "<h2>Les Ath Yenni</h2> <p class='firstP'>Les Ath Yenni sont initialement une tribu Kabyle, selon Ibn Khaldoun ils font partie de la confédération des Zouaoua, mais aujourd’hui elle est également une commune de Tizi Ouzou, composé de plusieurs localités celle-ci sont : Taourirt Mimoun (chef-lieu de la commune), Aṭ Lahcène, Aṭ Larbaâ, Taourirt L'Hadjadj, Tigzirt, M'Draa.</p> <p>Cette tribu est connue pour son savoir-faire artisanal ancestral qu'ils transmettent depuis plusieurs générations, en effet en plus d'être d’anciens fabricants d'armes, principalement de fusils, ils sont aussi fabricant de poterie et de tapisserie, mais ils sont surtout connus pour leurs bijoux.</p> <h2>Les bijoux d’Ath Yenni</h2> <p>Les bijoux kabyles sont un savoir-faire ancestral de la tribu des Ath Yenni, la transmission de ce savoir-faire est essentiellement familiale, transmis de père en fils, maintenant on retrouve aussi des femmes à qui ce savoir-faire a été transmis. Aujourd’hui, il existe des écoles pour apprendre la conception de ses bijoux, comme le CFPA Des arts (AT) Boukhalfa a Tizi Ouzou.</p> <h2>Fabrication</h2> <p>Ces bijoux sont faits d’argent avec un ornement en coraux. Ils sont essentiellement décorés avec les couleurs vertes, jaune, rouge et bleu, ses couleurs symbolise les éléments de la nature, c'est-à-dire jaune, soleil, le ciel, la terre et les plaines, ses quatre couleurs sont également les couleurs des étendards des rois de Numidie. Les bijoux des Ath Yenni comme tout, ils n’ont pas échappé à la modernisation en effet les nouveaux artisans pour atteindre les nouvelles générations et continuer à faire vivre se savoir l’ont un peu modernisé en ajoutant de nouvelles couleurs telles que le turquoise, mais ses bijoux garde leur authenticité [2]. Les principaux bijoux fabriquer sont des bracelets, des ceintures, des boucles d’oreille, des diadèmes et des épingles.</p> <p>Ces bijoux sont un accessoire essentiel dans la vie d’une femme kabyle, elle les porte dans la vie de tous les jours comme dans les différents événements important de sa vie comme par exemple son mariage.</p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/articles/lalaam'> Laalam, un village à la nature sauvage qui attire les touristes algériens</a></p> <h2>Renommé</h2> <p>Leur succès dépasse cette tribu ou même la Kabylie, ces bijoux sont populaires dans toute l’Algérie, mais pas uniquement, puisqu'ils sont aussi populaires en Europe, notamment chez la diaspora algérienne et particulièrement dans la diaspora Kabyle.</p> <p>On retrouve également de nombreux bijoux importer en France comme des trophées militaire ou par des ethnologues pour étudier les différentes ethnies en Algérie pendant la conquête française, ils sont aujourd’hui gardés au muséum d’Histoire naturelle de Toulouse, mais ils ne sont pas exposé pour différentes raison.</p>",
