      body: "La blouza ou communément appelé la blouza oranaise est une tenue algérienne qui voit initialement le jour à Tlemcen au XXe siècle, cette robe est l’évolution de d’une autre tenu Algérienne, la robe abaya.\n\nCette robe a su se déplacer à travers les régions d’Algérie, et a su également évoluer, elle porte d’autre nom dans les autres wilayas comme “Gendoura” (littéralement “la robe”) a Constantine, “binouar” a Sétif ou encore “blouza Naïli” dans les hauts plateaux.\n\n\nToutes ses régions ont su s’approprier cette robe grâce à leurs évolutions.\n\n\n## La conception de la blouza\n\nCette tenue arrive dans la ville d’Oran grâce au couturier de Tlemcen qui ont émigré vers cette ville en apportant avec eux leur savoir-faire. Cette tenue est une longue robe sans manche cousu dans différente matière, on trouve essentiellement les matières suivantes : la soie, le velours, le coton, le nylon et la dentelle. Cette robe grâce aux différents influence d’Oran elle a eu plusieurs modifications, et c’est dans cette ville qu’elle a été moderniser.\n\n\nAujourd'hui la blouza moderne est très populaire en Algérie et c’est propagé dans toutes les régions, mais c’est à Oran ou naturellement elle est particulièrement la plus apprécier.",
