      title:
        "Laalam, un village à la nature sauvage qui attire les touristes algériens",
      body: "<p class='firstP'>Laâlam est un petit village méconnu qui se trouve au pied de Tababort entre Béjaïa, Jijel et Sétif.</p> <p> Ce petit village compte environ trois mille habitants, on y parle Tasaḥlit, une langue qui provient de la langue Kutama, ce dialecte est également parlé à Melbou, Aokas, Souk El Ténine, Kherrata, on trouve aussi des locuteurs de ce dialecte dans les wilayas voisines tel que Jijel et Sétif. Le territoire où se trouvent ces locuteurs correspond historiquement à certaine fraction de la tribu des Kutuma. Les Ait Laâlam préfèrent appeler cette langue talaâlammite.<p> <h2> Histoire </h2> <p>Tababort fait partie de la chaine montagneuse des Babors, le toponyme de Babors existe depuis la période romaine, qui était connue sous le nom des Bavare, ou des Babare. Les Bavare sont une ancienne confédération des Babors, cette confédération est notamment connue pour s’être allié avec deux autres tribus Kabyles, les Quinquegentiens et les Fraxinenses contre l’empire romain.</p> <h2> Carte des tribus kabyles antique </h2> <img class='img-article-2' src='/article/laalam/tribu.png'> <br/> <div class='credit'>Crédit image : <a  href='journals.openedition.org'>journals.openedition.org</a></div> <br> <br> <p>Durant la colonisation française, le village de Laâlam n’était pas rattaché à la ville de Béjaïa, il faisait partie de la commune mixte de Tababort, cette commune faisait partie de ville de Djidjelli, l’actuel Jijel, bien qu’elle fît partie d’une commune mixte, la présence de colon était inexistante dans le village de Laâlam, c’est bien plus tard lors de la guerre d’Algérie que la première route vers ce village a été construite par l'armée française.</p> <p>Après l'indépendance, Tababort réintègre la ville de Béjaïa, plus tard le village de Laâlam ne sera plus rattacher à Tababort, mais a la commune de Tamridjet.</p> <p>En 2006, un événement dramatique secoue Laâlam, le 20 mars 2006, un violent séisme fait environ 4 morts et 78 blessés et une centaine de maisons détruites. Laâlam était presque méconnu par la majorité des Algériens avant ce drame.</p> <p>Aujourd'hui ce village, c'est remis de ses plaies, malgré un développement insuffisant, Laâlam attire de plus en plus de touriste, qui souhaite faire du tourisme d'aventure.  </p> <img class='laalam3' src='/article/laalam/laalam1.jpg'> <h2> Tourisme </h2> <p>Depuis quelques années, il y a un engouement autour de ce village, des touristes de toute l'Algérie viennent découvrir, la nature sauvage de Laâlam et de ses extraordinaires cascades qui rendent ce village unique. Cet été, des touristes d'Adrar ont visité ce village, ils étaient étonnés par la beauté des rivières et des cascades.</p> <h2> Agriculture </h2> <p>Comme la plupart des villages kabyles, Laâlam est un village agricole dont les terres cultivables sont ancestrales.</p> <p>Dans ce village, on y cultive un peu de tout, mais surtout des figues, des figues de barbarie, des courges, des haricots, néanmoins le produit phare qui est cultivé dans ce village, c'est la prune. On y cultive plusieurs variétés telles que notamment « la mirabelle » et « le santa-rosa ». Elles sont également cultivées dans ses différentes couleurs.</p>  <p>Chaque année, le village organise pendant l'été, la fête de la prune, pour mettre en avant les prunes du village et par extension tout le village.</p> <p>Malgré ce nouvel engouement, les nombreux touristes qui viennent visiter   le village et les efforts fournis par les Aït Laâlam, les habitants souhaitent avoir plus de moyen, notamment avec l'ouverture de nouvelle route qui leur faciliterait l'accès à l'éducation et à la santé, en effet l'ouverture de nouvelles routes telle que Melbou Laâlam leur permettra de réduire considérablement le temps du trajet entre les Hôpitaux, les lycées et les universités et le village, cette route leur permettra également développer le tourisme dans le village.</p>",
