      id: 8,
      title: "Le raï, une richesse musicale du patrimoine algérien",
      body: "<p class='firstP'>L’Algérie possède une richesse musicale unique, presque toutes les régions en leur propre style musical, certaines régions en possèdent plusieurs, à l'image de l’ouest algérien qui possède notamment le Bedoui oranais, l’Allaoui ou encore le raï.</p> <h2>L'origine du raï</h2> <p>Le raï est un genre musical algérien né au XXe siècle dans l’oranis (Oran, Sidi-bel-Abbès et Aïn Témouchent). Ce genre musical est l’évolution du Bedoui appelé aussi gharbi, un genre de musique traditionnel algérien poétique accompagné de deux flûtistes de gasba et un gallal.</p> <h2>L'évolution du raï</h2> <p>La modernisation du raï à commencer vers la fin des années 60, avec l’introduction d’instrument moderne tel que la guitare électrique et l’accordéon, dans les années 80 les synthétiseurs et les boîtes à rythmes font leur apparition, le raï s’imprègne des styles rock, pop, funk, reggae et disco. Durant la même période, de nouveaux artistes émergents tels que Cheb Khaled, Cheb Mami, Cheb Hasni, ou encore Cheba Zahouania.</p> <h2>Le raï dans la société algérienne </h2> <p>Le rai est initialement un genre de musique interdit de diffusion dans à la télévision et à la radio, il n'était pas acceptable d'écouter du raï en famille, en effet à cause des paroles vulgaires qui parle notamment d'alcool et d’amour, dans la société conservatrice algérienne le raï est vu comme une musique de débauche ou qui mène à la débauche.</p> <p>Ce genre musical s'est donc développé grâce à des soirées, des festivals et des concerts, qui sont surtout fréquentés par des jeunes attirés par l’interdit. Aujourd’hui le raï a bien évolué, il s'est démocratisé, les paroles se sont diversifiées, on retrouve beaucoup de musiques pas vulgaires. Ces musiques sont jouées en tout lieu, contrairement au passé, le raï est diffusé aussi bien à la télévision qu'à la radio et parfois, il est même écouté en famille, notamment lors des différents événements de la vie, comme les mariages ou le raï est régulièrement diffusé </p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/articles/la-blouza'>La blouza, une tenu qui a su conquérir le cœur des oranaise</a></p> <h2>Internationalisation du raï</h2> <p>À partir de la fin des années 1980, le raï à commencer à s'exporter à l’étranger grâce à la diaspora algérienne, en effet les Algériens diffusait dans leur bar de la musique raï, tel que des musiques de Cheb Khaled ou de Cheikha Remitti parfois grâce à la demande de leur client, mais aussi grâce à des représentations de chanteur de raï dans les bar algériens, mais aussi plus tard grâce à des concerts tenus par les artistes algériens en France. Le Raï sera propulsé en Europe grâce à des artistes tels que Cheb Khaled, Cheb Mami, ou encore le groupe “un, deux, trois, soleils” composé de Faudel, Khaled et Rachid Taha. Aujourd’hui le raï continue son expansion à l'international, des nouveaux artistes font revivre les classiques d'autrefois, comme DJ Snake avec le titre “trigue el lycée” en collaboration avec Cheb Khaled, DJ Snake a aussi fait revivre la célèbre maison de disque Disco Maghreb.</p> <h2>Le raï aujourd’hui</h2> <p>Aujourd’hui le raï est toujours aussi populaire en Algérie, mais aussi de plus en plus dans le monde, en effet en plus d’être écouté par la diaspora algérienne en Europe ou en Amérique, ce style de musique a conquis le cœur du monde arabe, mais pas seulement, car on retrouve des boutiques qui vendent et des fans inconditionnels de la musique raï jusqu’au Japon.</p>",
