      id: 9,
      title: "Arbre généalogique des rois numides",
      body: "<p class='firstP'>La Numidie est ancien royaume antique d’Afrique du Nord, placer entre la Mauritanie antique et Carthage, ce qui correspond historiquement au Maghreb central, l’Algérie actuels. Initialement diviser en deux les Massæsyles et les Massyles (la Numidie occidentale et la Numidie orientale).<p/> <p>Après la mort de Gaïa, roi des Massyles, Syphax, roi des Massæsyles, tente de s’emparer des Massyles avec l’aide de Carthage.</p> <p>Massinissa fils de Gaïa, à l'origine allier de Carthage se sent trahi, il s’allie avec Rome pour garder son royaume. Il réussit à défaire Syphax, il garde son trône et unifie la Numidie.</p><h2>Arbre généalogique des rois numides</h2> <div class='arbre-numide'> <img src='/article/massinissa/Arbre généalogique des rois numides.svg' alt='arbre genealogie-des-rois-numides'> </div>",
      resumer:
        "La Numidie est ancien royaume antique d’Afrique du Nord, placer entre la Mauritanie antique et Carthage, ce qui correspond historiquement au Maghreb central, l’Algérie actuels. Initialement diviser en deux les Massæsyles et les Massyles (la Numidie occidentale et la Numidie orientale). Après la mort de Gaïa, roi des Massyles, Syphax, roi des Massæsyles, tente de s’emparer des Massyles avec l’aide de Carthage. Massinissa fils de Gaïa, initialement allier de Carthage se sent trahi, il s’allie avec Rome pour garder son royaume. Il réussit à défaire Syphax, il garde son trône et unifie la Numidie...",
