      resumer:
        "Les Zianides ou également appeler les Bānu ʿabd āl-Wād sont une tribu Zénète des aures, en 1236 Yaghmoracen Ibn Ziane fonde dans la région de Tlemcen le royaume Zianides de Tlemcen , cette dynastie gouverne une partie du Maghreb central, l’Algérie actuelle jusqu'à 1556, la régence d’Alger lui succède. La ville de Tlemcen devient la capitale du royaume de Tlemcen, durant cette période   Tlemcen devient une des villes les plus riches d’Afrique du Nord ou le niveau de vie est élevé. Ibn Khefadja de Cordoue a dit de Tlemcen : « Le paradis de l'éternité, ô Tlemceniens ne se trouve que dans votre patrie, et s'il m'était donné de choisir, je ne voudrais pas d'autres que Tlemcen »...",
