      id: 13,
      title: "Juba II, un roi savant",
      body: "<p class='firstP'>Juba II est né vers 46 av. J.-C a Hippone, l’actuel Annaba en Algérie. Il était un roi numide puis un roi de Mauritanie. Il devient roi de Numidie de 30 av. J.-C. à 25 av. J.-C par la suite de 25 av. J.-C à 23 ap. J.-C., il devient roi de Mauritanie.</p> <p>Il est  le descendant d’une illustre lignée de roi numide. Il est le fils de Juba I, le roi précédent de Numidie, petit-fils de Hiempsal II, descendant de Massinissa l'unificateur de la Numidie, une région qui correspond à l'actuelle Algérie. Il était marié à Cléopâtre Séléné, la fille de Cléopâtre VII d'Egypte et de son époux romain Marc Antoine.</p> <h2>Enfance et accession au trône</h2> <p>Juba Ier allié de Pompée, est vaincu par César, après la défaite de son père, Juba II est pris en otage par Rome, ainsi, il grandira dans une prison dorée et sera élevé par Octavia. Il reçut une formation supérieure et étudia les sciences, les lettres et les arts. Il devint un homme instruit avec de grandes connaissances.</p> <p>Lorsqu'il accéda au trône. Il encourage et appuie les arts de la scène, la recherche scientifique, linguistique et mathématique. Il a aussi mis en œuvre des réformes dans le but d'améliorer la vie de son peuple. Il bâtit des routes, des aqueducs et des édifices publics afin d'améliorer les services de base. Il a également établi des écoles d'enseignement des sciences et des lettres aux enfants. Selon l'historien grec Plutarque, il était l'un des meilleurs hommes d'État de son époque</p> <h2>Juba II et les sciences </h2> <p>Il était considéré par les écrivains de l'antiquité comme un lettré et un érudit, selon Pline l'ancien, « sa réputation de savant et plus mémorable que son règne ». Il a écrit de nombreux livres en grec et en latin, notamment d'histoire naturelle, de géographie et de grammaire (latine, grecque, berbère, assyrienne et égyptienne), malheureusement ces livres nous sont parvenus uniquement en fragment.</p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/article/arbre-genealogie-des-rois-numides'> Arbre généalogique des rois numides des rois Numides</a></p> <p>Il était en outre un grand collectionneur d'art et de livres. Il assembla une grande bibliothèque dans son palais et attira des érudits et des artistes de tout l'Empire romain pour renforcer sa cour. </p> <h2>Sa renommée, sa fin et sa succession </h2> <p>Avant de mourir, en 19 ap. J.C. Juba II nomme son unique fils Ptolémée, corégent de Numidie puis de Mauritanie, il meurt finalement  en 23 ap. J.-C. son fils Ptolémée lui succède en tant que roi de Maurétanie.</p> <p>Juba II règnera sur un royaume plus grand que celui de son père Juba I, en effet la numidie annexé par Rome Juba II deviendra roi de Mauritanie, il fit de Césarée, l'actuelle Cherchell en Algérie, sa capitale, la ville devint un lieu culturel important. Ce royaume comprenait une grande partie du Maghreb actuel. Cependant, son nom est resté dans l'histoire en raison de ses réalisations en matière de développement des sciences et de culture. On considère qu'il est l'un des rois les plus éclairés de l'antiquité. Son épouse Cléopâtre Séléné joua un rôle important dans la cour de Juba II en tant que reine.</p>",
      resumer:
        "Juba II est né vers 46 av. J.-C a Hippone, l’actuel Annaba en Algérie. Il était un roi numide puis un roi de Mauritanie. Il devient roi de Numidie de 30 av. J.-C. à 25 av. J.-C par la suite de 25 av. J.-C à 23 ap. J.-C., il devient roi de Mauritanie. Il est  le descendant d’une illustre lignée de roi numide. Il est le fils de Juba I, le roi précédent de Numidie, petit-fils de Hiempsal II, descendant de Massinissa l'unificateur de la Numidie, une région qui correspond à l'actuelle Algérie. Il était marié à Cléopâtre Séléné, la fille de Cléopâtre VII d'Egypte et de son époux romain Marc Antoine.",
