      id: 14,
      title: "L'Art de la Miniature Algérienne, l'héritage de Mohammed Racim",
      body: "L'Art de la Miniature Algérienne, l'héritage de Mohammed Racim <p class='fristP'> Mohammed Racim est né en 1896 dans la Casbah d'Alger, où il grandit au sein d'une famille d'artistes. Il est considéré comme l'un des plus grands peintres miniaturistes de l'Algérie moderne. Après avoir obtenu son certificat d’études, il entre au Cabinet de Dessin de l’Enseignement Professionnel. Il y étudie les motifs graphiques et découvre la miniature, grâce à des bourses qu’il obtient, Racim fait de nombreux voyages notamment en Andalousie et à Londres, ses nombreux voyages ont joué un rôle important dans son développement en tant qu'artiste. </p> <p>En 1934, il intègre L'École des Beaux – Arts d’Alger, où il enseigne l’Art de la Miniature Algérienne. </p> <h2> Renommée </h2> <p>Racim était connu pour ses œuvres hautes en couleur et en détails, qui ont captivé les spectateurs avec leurs thèmes traditionnels tels que les paysages, les scènes de la vie quotidienne, les contes et les légendes. Ses peintures sont considérées comme des témoignages importants de la culture algérienne et de son histoire, et sont encore largement appréciées aujourd'hui pour leur beauté et leur importance culturelle.</p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/article/hommage-au-raïs-hamidou'> Hommage au Raïs Hamidou</a></p> <h2> Minatures célèbres </h2> <p>Parmi ses miniatures les plus célèbres, on retrouve : “Nuit de Ramadan”, « La Casbah », « Terrasses de la casbah »,« Bataille naval » </p> <div class='container-img-racim' > <div class='img-racim'> <div class='img'> <img src='/article/mohammedR/ramadan.jpg' alt='Nuit de Ramadan'> </div> <p class='crédit-img'>« Nuit de Ramadan » </p> </div> <div class='img-racim'> <div class='img' > <img src='/article/mohammedR/lacasbah.jpeg' alt='La Casbah'> </div> <p class='crédit-img'>« La Casbah » </p> </div> <div class='img-racim'> <div class='img'> <img src='/article/mohammedR/casbah.jpg' alt='Terrasses de la casbah'> </div> <p class='crédit-img'> « Terrasses de la casbah » </p> </div> <div class='img-racim'> <div class='img'> <img src='/article/mohammedR/bataille-naval.jpg' alt='Bataille naval'> </div> <p class='crédit-img'>« Bataille naval » </p> </div> </div> <h2> Fin tragique </h2> <p>Malheureusement, la vie de Mohamed Racim a été brutalement interrompue par un assassinat chez lui à El Biar, Alger. Les criminels auraient emporté avec eux beaucoup de ses peintures. Ce terrible événement a privé le monde de l'art d'un artiste talentueux. Cependant, son héritage continue de subsister grâce à ses peintures, qui sont conservées et exposées dans des musées et des collections privées du monde entier.</p> <p>Mohamed Racim était-il le plus grand miniaturiste de son temps ?</p>",
      resumer:
        "Mohammed Racim est né en 1896 dans la Casbah d'Alger, où il grandit au sein d'une famille d'artistes. Il est considéré comme l'un des plus grands peintres miniaturistes de l'Algérie moderne. Après avoir obtenu son certificat d’études, il entre au Cabinet de Dessin de l’Enseignement Professionnel. Il y étudie les motifs graphiques et découvre la miniature, grâce à des bourses qu’il obtient, Racim fait de nombreux voyages notamment en Andalousie et à Londres,  ses nombreux voyages ont joué un rôle important dans son développement en tant qu'artiste.",
