      id: 15,
      title:
        "Les Black Panthers trouvent refuge en Algérie : Récit d'un détournement d'avion",
      body: "<p class='firstP'>Après que l'Algérie a obtenu son indépendance, elle est devenue un symbole de l'anticolonialisme et de l'anti-impérialisme. Durant la période des années 60 et 70, l'Algérie a offert un refuge, et un soutien de nombreux groupes qui se battaient pour la libération de leur pays ou pour la justice sociale et raciale.</p> <h2>Les Black Panthers en exil en Algérie après des détournements d'avion</h2> <p>Eldridge Cleaver, écrivain et l'un des militants membres des Black Panther les plus connus, fuyant les États-Unis a obtenu l'asile politique en Algérie, où il a trouvé refuge à Alger. D'autres membres des Black Panther l’ont suivi, notamment lors des deux détournements d'avion vers Alger, à l'image du vol 841 de Delta Air Lines en 1972.</p> <p>Le 31 juillet 1972, George Wright, George Brown, Joyce Brown accompagnée de sa fille de deux ans, Melvin McNair et Jean Carol Allen McNair accompagnée de sa fille d'un an et de son fils de deux ans, ont détourné le vol 841 de Delta Air Lines qui reliait Détroit à Miami.</p> <h2> La rançon d'un million de dollars</h2> <p>les pirate de l'air ont réclamé une rançon d'un million de dollars au FBI pour relâcher les passagers de l'avion qui étaient détenus en otage. Sur le tarmac de l'aéroport, un agent du FBI en maillot de bain leur apporte leur rançon dans une valise. Après avoir obtenu ce qu'ils souhaitaient, les pirates de l'air ont libéré les otages et ont détourné l'avion vers l'Algérie.</p> <div class='fbi-img'> <img src='/article/Alger/bpma.jpg'> </div> <h2> le sort de équipage de bord et des pirates de l'air </h2> <p>La rançon ainsi que l'avion et son équipage de bord, qui étaient pris en otage, sont repartis aux États-Unis, tandis que les pirates de l'air ont été placés en garde à vue avant d'obtenir l'asile politique.</p> <p>Durant cette période, la capitale algérienne était surnommé “la Mecque des révolutionnaires”<p>",
      resumer:
        "Après que l'Algérie a obtenu son indépendance, elle est devenue un symbole de l'anticolonialisme et de l'anti-impérialisme. Durant la période des années 60 et 70, l'Algérie a offert un refuge, et un soutien de nombreux groupes qui se battaient pour la libération de leur pays ou pour la justice sociale et raciale.",
