      id: 17,
      title: "Le Haïk, un vêtement emblématique des femmes d'Alger",
      body: "<p class='firstP'>Le Haïk, ce vêtement traditionnel féminin, est porté depuis plusieurs siècles par les femmes algériennes. Si la manière de le porter à évoluer, ce drapé est pourtant une pratique ancestrale. Considéré comme l'un des symboles majeurs de la culture algérienne, il est aujourd'hui devenu une tenue emblématique des femmes d'Alger, représentant l'identité et la fierté de tout un peuple. </p> <h2>Caractéristiques du Haïk </h2> <p>Cette tenue est caractérisée par un voile blanc qui enveloppe le corps entier de la femme et qui est généralement accompagné d'un a'jar, une sorte de voilette blanche ornée parfois de broderies ou de motifs décoratifs, qui cache la moitié du visage. Le port du haïk est souvent associé à la piété et à la vertu, et est étroitement lié à la tradition islamique, car il répond aux exigences de l'islam. Le haïk enveloppe le corps de la femme dans un voile, la protégeant ainsi des regards indiscrets et préservant sa dignité.</p> <div class='container-haik-ville'> <div class='img-haik'  > <img src='/article/Alger/haik/hold.jpg' alt='affiche de propagande'> <p class='crédit-img'>Haïk recouvrant tout le corps et le recouvert d'un A'jar </p> </div> </div> <h2>Le Haïk durant la guerre d’Algérie </h2> <p>Pendant la guerre d'Algérie, malgré les tentatives de la propagande coloniale visant à dévoiler les femmes algériennes et les séparer de leur religion et de leur culture, les femmes algériennes fières de ce qu’elles sont ont continué à porter le haïk fièrement. Durant cette période, le haïk est devenu un symbole de résistance pour de nombreuses femmes, il était considéré comme un moyen de défendre leur culture et leur patrimoine, tout en faisant preuve de détermination face à l'oppression coloniale. En outre, le haïk a également été utilisé pour cacher et transporter des armes, de la nourriture et d'autres fournitures à travers les points de contrôle français.</p> <div class='container-haik-ville'> <div class='img-haik'  > <img src='/article/Alger/haik/mvgscntoomx71.webp' alt='affiche de propagande'> <p class='crédit-img'>Affiche de propagande coloniale </p> </div> <div class='img-haik' > <img src='/article/Alger/haik/haik-check.jpg' alt='haïk dans un point de controle francais'> <p class='crédit-img'>Dans un point de controle </p> </div> </div> <h2>Le Haïk dans les autres villes d’Algérie</h2> <p>Le haïk n'était pas seulement porté à Alger, mais aussi dans d'autres villes d'Algérie telles que Béjaïa, Tlemcen, Oran et Constantine. Dans cette dernière ville, le vêtement est appelé M'laya. Depuis la mort de Salah Bey en 1792, les femmes endeuillées ont choisi de le porter en noir pour honorer leur deuil. Le haïk est toujours porté et est très populaire auprès des femmes mozabites où elle le porte fièrement notamment dans la région de Ghardaïa. </p> <div class='container-haik-ville'> <div class='img-haik'  > <img src='/article/Alger/haik/Salah_Bey_صالح_باي.jpg' alt='Salah Bey'> <p class='crédit-img'>Salah Bey</p> </div> <div class='img-haik' > <img src='/article/Alger/haik/mlaya.jpg' alt='Mlaya Constantinoise'> <p class='crédit-img'>M'laya Constantinoise</p> </div> </div> <h2>Le haïk aujourd’hui </h2> <p>Le haïk est un vêtement traditionnel féminin d'une grande importance historique et culturelle en Algérie. Avec une histoire qui remonte à plusieurs siècles, le haïk est devenu un symbole emblématique de l'identité algérienne et de la lutte contre l'oppression coloniale. Encore porté aujourd'hui lors d'événements culturels, le haïk est un héritage culturel précieux qui contribue à la richesse patrimoniale de l'Algérie. Le haïk est donc un symbole fort de l'identité algérienne.</p>",
      resumer:
        "Le Haïk, ce vêtement traditionnel féminin, est porté depuis plusieurs siècles par les femmes algériennes. Si la manière de le porter à évoluer, ce drapé est pourtant une pratique ancestrale. Considéré comme l'un des symboles majeurs de la culture algérienne, il est aujourd'hui devenu une tenue emblématique des femmes d'Alger, représentant l'identité et la fierté de tout un peuple.",
