      id: 19,
      title: "Cheikh El Anka une icône de la culture populaire algérienne.",
      body: " <p class='fristP'>Mohamed Idir Aït Ouarab, mieux connu sous le nom d'El Hadj M'Hamed El Anka, ou encore cheikh El Anka, est une figure emblématique de la musique algérienne. Il a vu le jour le 20 mai 1907 dans la Casbah d'Alger, et ses origines remontent à la Kabylie, plus précisément à Freha, à Tizi-Ouzou. Dès son jeune âge, il se lança dans le monde du travail pour soutenir sa famille, mais sa véritable passion se trouvait dans la musique. À l'âge de 13 ans, il attira l'attention du musicien Mustapha Nador, un moment décisif dans sa carrière artistique.</p> <p class='read-to'><span class='title-read-to'>Lire aussi :</span><a href='/article/Le-Haik-un-vetement-emblematique-des-femmes-d-Alger'> Le Haïk, un vêtement emblématique des femmes d'Alger </a></p> <h2>Le Fondateur du Chaabi Algérois</h2>  <p>Cheikh El Anka est célèbre pour avoir fondé un nouveau genre musical, le chaabi algérois, en s'inspirant à la fois de la tradition du medh et de l'héritage musical andalou. En 1928, sa carrière prit un tournant majeur lorsqu'il enregistra 27 disques 78 tours avec Columbia Records et participa à l'inauguration de la Radio PTT Alger, ce qui le propulsa à la renommée dans tout le pays. Sa carrière est marquée par des titres emblématiques tels que « Hamdoulillah mabqach istiîmar fi bladna », sorti en 1962, et « Mersoul Fatma » marquent l'histoire de la musique algérienne.</p> <h2>Un Héritage Culturel Immortel</h2> <p>Après une carrière de 50 ans couronnée de succès, Cheikh El Anka nous quitta à l'âge de 71 ans, le 23 novembre 1978, à Alger. Son héritage musical perdure grâce aux enseignements qu'il a transmis à ses élèves. Aujourd'hui, il est devenu une icône de la culture populaire algérienne, aimée et appréciée par tous les Algériens. Son influence et son génie musical continuent d'inspirer de nouvelles générations d'artistes, perpétuant ainsi la mémoire du cardinal de la musique chaabi, El Hadj M'Hamed El Anka.</p>",
